import Card from "../card/Card";
import styled from "./Cards.module.css";

export default function Cards({ characters, onClose }) {

  return (
    <div className={styled.Cards2}>
      {characters.map(({ id ,name, species, gender, image }) => {
        return (
          <Card
            
            id= {id}
            name={name}
            species={species}
            gender={gender}
            image={image}
            onclose={onClose}
          />
        );
      })}
    </div>
  );
}
